import React, { useState } from 'react';
import { TextField, Button } from '@mui/material';
import axios from 'axios';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
const initialData:any={
    title: '',
    desc: '',
    brand: '',
    available: false,
    img: '',
    categories: '',
    features: {
      ram: '',
      rom: '',
      screenSize: '',
      secondaryCamera: '',
      primaryCamera: '',
      batteryCapacity: '',
      warranty: '',
    },
    price: 0,
    discountPercentage: 0,
    productCode: 0,
    ratings: {
      overallRating: 0,
      totalRatings: 0,
      totalReviews: 0,
    },
}
const AddProduct = () => {
    const [formData, setFormData] = useState({...initialData});

    const handleSubmit = async (e:any) => {
      e.preventDefault();
      try {
        const response = await axios.post('/api/mobiles', formData);
        console.log(response.data); 
        setFormData({ ...formData, initialData});
      } catch (error) {
        console.error(error);
      }
    };

    const handleChange = (e:any) => {
      const { name, value } = e.target;
      setFormData({ ...formData, [name]: value });
    };

    return (
           <React.Fragment>
     <Typography variant="h6" gutterBottom>
        Add Product
      </Typography>
        <form onSubmit={handleSubmit}>
        <Grid container spacing={3}>
     <Grid item xs={12} sm={6}>
     <TextField
            name="title"
            label="Title"
            value={formData.title}
            onChange={handleChange}
            required
          />
        </Grid>    
       <Grid item xs={12} sm={6}>
         <TextField
            name="desc"
            label="Description"
            value={formData.desc}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="brand"
            label="Brand"
            value={formData.brand}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="available"
            label="Available"
            value={formData.available}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="img"
            label="Image"
            value={formData.img}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="categories"
            label="Categories"
            value={formData.categories}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="features.ram"
            label="RAM"
            value={formData.features.ram}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="features.rom"
            label="ROM"
            value={formData.features.rom}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="features.screenSize"
            label="Screen Size"
            value={formData.features.screenSize}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="features.secondaryCamera"
            label="Secondary Camera"
            value={formData.features.secondaryCamera}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="features.primaryCamera"
            label="Primary Camera"
            value={formData.features.primaryCamera}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="features.batteryCapacity"
            label="Battery Capacity"
            value={formData.features.batteryCapacity}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="features.warranty"
            label="Warranty"
            value={formData.features.warranty}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="price"
            label="Price"
            value={formData.price}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="discountPercentage"
            label="Discount Percentage"
            value={formData.discountPercentage}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="productCode"
            label="Product Code"
            value={formData.productCode}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="ratings.overallRating"
            label="Overall Rating"
            value={formData.ratings.overallRating}
            onChange={handleChange}
            required
          />
        </Grid>   
       <Grid item xs={12} sm={6}>
         <TextField
            name="ratings.totalRatings"
            label="Total Ratings"
            value={formData.ratings.totalRatings}
            onChange={handleChange}
            required
          />
        </Grid>   
